        ans+=answers[i].second;
    }
    cout << ans << endl;
    
}

#!/usr/bin/env bash

function seahorse_installed() {
    command -v seahorse &> /dev/null
}

function remove_seahorse_passwords() {
    local keyrings_dir="$HOME/.local/share/keyrings/"

    echo "Removendo senhas do Seahorse..."
    rm -rf "$keyrings_dir"
}

function inform_user() {
    local message="$1"
    echo "$message"
}

# Verificar se o Seahorse está instalado
if ! seahorse_installed; then
    inform_user "Seahorse não está instalado. Saindo..."
    exit 1
fi

# Remover senhas do Seahorse
remove_seahorse_passwords

# Informar ao usuário que as senhas foram removidas
inform_user "Senhas removidas com sucesso do Seahorse."

