      , _parse_time_to_sec: function (p_time) {
        // 345 5m 5 min 1 hts 1 h 5мин 5 м 2 ч 222сек   333s 1h 2m
        const c_time_re = /[\d]+|[^\d]+/gi;
        const C_DEFAULT_BAD_TIME = 60;
        const tokens = p_time.match(c_time_re)

        if (!tokens || !tokens[0]) return C_DEFAULT_BAD_TIME;
        const t1_d = parseInt(tokens[0]) || C_DEFAULT_BAD_TIME;
        if (!tokens[1]) return t1_d;
        if (['s','ss','sec','с','сек'].indexOf(tokens[1]) !== -1 ) return t1_d;
        if (['m','mm','min','м','мин'].indexOf(tokens[1]) !== -1 ) return t1_d * 60;
        if (['h','hh','hrs','ч','час'].indexOf(tokens[1]) !== -1 ) return t1_d * 3600;
        return C_DEFAULT_BAD_TIME; 
    }

 ,  RGBToHSB: function(r, g, b) {
        r /= 255;
        g /= 255;
        b /= 255;
        const v = Math.max(r, g, b),
            n = v - Math.min(r, g, b);
        const h =
            n === 0 ? 0 : n && v === r ? (g - b) / n : v === g ? 2 + (b - r) / n : 4 + (r - g) / n;
        return [60 * (h < 0 ? h + 6 : h), v && (n / v) * 100, v * 100];
    }

    /* #FFAAFF */
  , hexToRGB: function(hex){
        const red = parseInt(hex.substring(1, 3), 16);
        const green = parseInt(hex.substring(3, 5), 16);
        const blue = parseInt(hex.substring(5, 7), 16);
        return [red, green, blue];
    }
 



