function ve_process_queue(p_options)  { 

    if (GlobalVariables.VE.init_stage === 0) {
        log.info('ve_process_queue: auto-init vds_ext_base from ve_process_queue');
        global.vds_ext_base_init();
    }

    if (GlobalVariables.VE.init_stage !== 2) {
        log.info("ve_process_queue: Unable to init vds_ext_base script, script status = ${GlobalVariables.VE.init_stage}");
        return;
    }


   GlobalVariables.VE.QJ_TASK_ID += 1;
   const v_curr_task_id = GlobalVariables.VE.QJ_TASK_ID;
   p_options = p_options || {}; 
   const f = GlobalVariables.VE.f;

   let loop_counter = 0;
   let start_time = (new Date).getTime();
   let c_max_runtime_min = p_options.max_runtime_min || GlobalVariables.VE.C_MAX_JOB_RUNTIME_MIN || 10;

   /*
   if (VE.DEBUG) {
      const v_off_devices =GlobalVariables.VE.serv_list.filter(function(_e) {return _e.offTime} ).reduce(function(_p,_c) { return _p + _get_device_descr(_c)},' with off: '  );
      log.info("ve_process_queue: started({}) {}", v_curr_task_id.toFixed(),v_off_devices)
   } 
   */  
   check_off_time();

   function check_off_time() {
        const v_now = (new Date).getTime();

        if (v_curr_task_id !== GlobalVariables.VE.QJ_TASK_ID ) {
            //ve_log_debug("vds_ext_proc(${v_curr_task_id.toFixed()}): exiting " )
            return;
        }     
        if (loop_counter++ > 1000 || (v_now - start_time) > c_max_runtime_min * 60 * 1000 ) {
            f.ve_log_warning("vds_ext_proc(${v_curr_task_id.toFixed()}): exit due too long run" )
            return;
        }
        
        let is_time_off = v_now + 3600 * 1000; 
        let v_off_devices = ''
       GlobalVariables.VE.serv_list.forEach(function(_o) { 
            if (_o.ctypeOn && _o.offTime ) {

                // check attached MS for offTime extention    
                Object.keys(_o.msIds).forEach(function(_msId) { 
                    // if ms is on, extend offTime to OffTimeValue from now
                    const ms_obj =  f.obj_from_id(_msId);
                    const is_motion = Hub.getCharacteristicValue(ms_obj.a_id,f.obj_hc_from_full(ms_obj.ctypeMotionDetected) )
                    if (is_motion) {
                        _o.offTime =  (new Date).getTime() + _o.msIds[_msId];
                        f.ve_log_debug("vds_ext_proc(${v_curr_task_id.toFixed()}): motion ${_msId} detected, extend off time for ${f._get_device_descr(_o)}")
                    }
                })     
                    
                if (_o.offTime < v_now ) {
                    f.ve_log_info("vds_ext_proc(${v_curr_task_id.toFixed()}): turn off ${f._get_device_descr(_o)}, clear all ms" )
                    _o.offTime = 0;
                    _o.msIds = {};
                    Hub.setCharacteristicValue(_o.a_id, f.obj_hc_from_full(_o.ctypeOn), false )  
                } else {
                   is_time_off = Math.min(is_time_off, _o.offTime);
                   v_off_devices += f._get_device_descr(_o) + ' ';
                }    
            }
        })
        const v_delay = (is_time_off - v_now) > 20 * 1000 ? 20 * 1000 : is_time_off - v_now + 300;
        //ve_log_debug("vds_ext_proc(${v_curr_task_id.toFixed()}) next run: ${f.date_2_hhmmss(v_now + v_delay)} off schedule: ${v_off_devices||'empty'}")
        setTimeout(check_off_time, v_delay) 
   }

}


