function vds_ext_base_init(p_init_mode) {

    if (typeof GlobalVariables.VE.cached_paths !== "object" ) {
       GlobalVariables.VE.cached_paths = {}; 
       GlobalVariables.VE.QJ_TASK_ID =  (GlobalVariables.VE.QJ_TASK_ID||0) +  2;
