       GlobalVariables.VE.saved_states = {};
       GlobalVariables.VE.Statuses = {}; // { name, created, validbefore, }
       GlobalVariables.VE.ext_addons_funcs = {}

    }

    if (GlobalVariables.VE.init_stage === 1) {
       GlobalVariables.VE.f.ve_log_info('skip new init - already in progress');
    }

    if ( (p_init_mode === 'FORCE') || GlobalVariables.VE.acc_list.length === 0) {
        GlobalVariables.VE.f.ve_log_info("vds_ext: started");
        log.info("LI: vds_ext: started");
        GlobalVariables.VE.init_stage = 1;
        try {
           GlobalVariables.VE.f.ve_scan_hub_acccesories(); 
