        }
       GlobalVariables.VE.init_stage = 2;

        const a_stats = {}; GlobalVariables.VE.serv_list.forEach(function(_e) a_stats[_e.stype] = (a_stats[_e.stype]||0) + 1 )
        const v_a_stats_str = Object.keys(a_stats).reduce(function(_p,_c) {return _p + "${_c}: ${a_stats[_c]}, "},'' ).slice(0,-2)
        //const addons_avail = 'addons: ' + Object.keys(GlobalVariables.VE.ext_addons_funcs).join(',');
        //GlobalVariables.VE.f.ve_log_info("vds_ext ${VE_VERSION}: Accesories: ${GlobalVariables.VE.acc_list.length} Services: ${GlobalVariables.VE.serv_list.length} - " + v_a_stats_str /*+ '  ' + addons_avail*/)
        log.info("LI: vds_ext:" + "vds_ext ${VE_VERSION}: Accesories: ${GlobalVariables.VE.acc_list.length} Services: ${GlobalVariables.VE.serv_list.length} - " + v_a_stats_str /*+ '  ' + addons_avail*/)
    } 

}




/*
 *       .d8888. d88888b db      d88888b  .o88b. d888888b  .d88b.  d8888b. .d8888. 
 *       88'  YP 88'     88      88'     d8P  Y8 `~~88~~' .8P  Y8. 88  `8D 88'  YP 
 *       `8bo.   88ooooo 88      88ooooo 8P         88    88    88 88oobY' `8bo.   
 *         `Y8b. 88~~~~~ 88      88~~~~~ 8b         88    88    88 88`8b     `Y8b. 
 *       db   8D 88.     88booo. 88.     Y8b  d8    88    `8b  d8' 88 `88. db   8D 
 *       `8888Y' Y88888P Y88888P Y88888P  `Y88P'    YP     `Y88P'  88   YD `8888Y' 
 *
 */



function _$(p_filters) {
    const g = GlobalVariables.VE;
    const f = GlobalVariables.VE.f;
    let v_acc_ids = []; // current device list
    let local_debug = false || (g.DEBUG_LEVEL === 'debug'); 
    const c_tokens_re = /([@$#][^@$#]+)/gi;
    let localStateName = '';

    function _set_char_timeout(p_a_id, p_hc_id, p_value)
        {
            local_debug && log.info("_set_char_timeout {} {} {}", p_a_id, p_hc_id, p_value)
            Hub.setCharacteristicValue(p_a_id, p_hc_id, p_value);
        }

    function _setCharacteristic(p_object, p_cname, p_new_value, p_delay)
        {
            let v_cname = p_cname.substr(0,5) === "ctype" ? p_cname : 'ctype' + p_cname;
            let v_new_value = p_new_value
            if (v_cname === "ctypeOn") {
                if (typeof v_new_value === "string") v_new_value = v_new_value === "true";
                if (typeof v_new_value === "number") v_new_value = v_new_value ? true : false;
            }
           local_debug && log.info("setCharacteristic {} {}:{} {}", v_cname, typeof v_new_value, v_new_value, (p_delay ? 'delay: ' + p_delay : ''))

           if (!p_delay) {
               Hub.setCharacteristicValue(p_object.a_id, f.obj_hc_from_full(p_object[v_cname]),v_new_value);
           } else {
               setTimeout(_set_char_timeout, p_delay, p_object.a_id, f.obj_hc_from_full(p_object[v_cname]),v_new_value);
           }
        }



    function _apply_filter(p_obj_or_id, p_filter) {
        let v_obj = typeof p_obj_or_id === "object" ? p_obj_or_id : f.obj_from_id(p_obj_or_id);

        if (!v_obj) return false;
        const v_tokens = p_filter.match(c_tokens_re)
        if (v_tokens.length === 0) return false;
        let is_ok = true;
        v_tokens.forEach(function(_t) {
           if (!is_ok) return;
           const t = _t.trim().toUpperCase();
           if (t[0] === '@') is_ok = v_obj.room.toUpperCase() === t.substr(1);
           if (t[0] === '$') is_ok = v_obj.sname.toUpperCase() === t.substr(1);
        })
        return is_ok;
    }


    function _filter(p_filter) {
        if (!p_filter) return;
        if (g.cached_paths[p_filter]) {
            v_acc_ids = v_acc_ids.filter(function(_e) { return g.cached_paths[p_filter].indexOf(_e) !== -1; });
            return
        }

        const add_filters = p_filter.split(',')
        const v_filtered = []
        v_acc_ids.forEach(function(_obj) {
            add_filters.forEach(function(_curr_filter){
              if (_apply_filter(_obj, _curr_filter)) v_filtered.push(_obj)
            })
        })
        v_acc_ids = v_filtered;
    }

    function _global_serv_filter(p_path) {
        if (!p_path.trim()) return [];
        
        if (true && g.cached_paths[p_path]) {
            if (local_debug) console.log("_global_serv_filter: return cached paths for ${p_path} ")
            return g.cached_paths[p_path];
        }
        const add_filters = p_path.split(',')
        const v_filtered = []
        g.serv_list.forEach(function(_obj) {
            add_filters.forEach(function(_curr_filter){
              if (_apply_filter(_obj, _curr_filter)) v_filtered.push(_obj.id)
            })
        })
        g.cached_paths[p_path] = v_filtered.map(function(_e) { return _e}); // clone array
        return v_filtered;
    }

    function checkAffectedDevices() {
      if (v_acc_ids.length > g.C_MAX_DEVICES_AFFECTED) {
        f.ve_log_warning("слишком много управлемых устройств ${v_acc_ids.length}");
        return false;
      }
      return true;
    }

    let builder = {
        b_not_filtered: true,
        acc_ids: v_acc_ids,
        is_debug: function() {return local_debug; },
        get_acc_ids: function() { return v_acc_ids ;},
        filter: function(p_filter) {
            
            if (b_not_filtered) {
               v_acc_ids = _global_serv_filter(p_filter).map(function(_e) { return _e});
            } else {
               _filter(p_filter)
            }
            
            b_not_filtered = false;
            return builder;
        },
        setOn: function(p_params) {
            if (!checkAffectedDevices()) return builder;
            v_acc_ids.forEach(function(_c) {
                const _o =  f.obj_from_id(_c)
                _o.offTime = 0;
                if (_o.ctypeOn) {
                    _setCharacteristic(_o,'ctypeOn', true)
                    f.ve_log_info("vds_ext: setOn ${f._get_device_descr(_o)}")
                }
            })
            return builder;
        },
        setOff: function(p_params){
            if (!checkAffectedDevices()) return builder;
            v_acc_ids.forEach(function(_c) {
                const _o =  f.obj_from_id(_c)
                _o.offTime = 0;
                 _o.offTimeValue = 0;
                _o.msIds = {};
                if (_o.ctypeOn) {
                   _setCharacteristic(_o,'ctypeOn', false)
                   f.ve_log_info("vds_ext: setOff ${f._get_device_descr(_o)}")
                }
            })
            return builder;
        },
        setOnFor: function(p_str_time, p_opt) {
            if (!checkAffectedDevices()) return builder;
            const v_seconds = f._parse_time_to_sec('' + p_str_time)
            const v_min_off = (new Date).getTime() + v_seconds * 1000;

            const v_ms_path = typeof p_opt === "object" ? p_opt.MS||'' : p_opt ||'';
            let v_ms_ids = {}; _global_serv_filter(v_ms_path).forEach(function(_e) { v_ms_ids[_e] = v_seconds * 1000; })
            v_acc_ids.forEach(function(_c) {
                const _o =  f.obj_from_id(_c)
                if (_o.ctypeOn) {
                    Object.keys(v_ms_ids).forEach(function(_e){ _o.msIds[_e] = Math.max(_o.msIds[_e]||0, v_ms_ids[_e]);  })
                    if (!_o.offTime || _o.offTime < v_min_off) {
                        _o.offTime = v_min_off;
                        Hub.setCharacteristicValue(_o.a_id, f.obj_hc_from_full(_o.ctypeOn), true )
                        f.ve_log_info("setOnFor ${f._get_device_descr(_o)} to +${v_seconds.toFixed()}")
                    }
                }
            })
            return builder;
        },
        extendFor: function(p_str_time, p_opt) { /* extend on time if accessory is already on */
            if (!checkAffectedDevices()) return builder;
            const v_seconds = f._parse_time_to_sec('' + p_str_time)
            const v_min_off = (new Date).getTime() + v_seconds * 1000;
            const v_ms_path = typeof p_opt === "object" ? p_opt.MS||'' : p_opt ||'';
            let v_ms_ids = {}; _global_serv_filter(v_ms_path).forEach(function(_e) { v_ms_ids[_e] = v_seconds * 1000; })

            v_acc_ids.forEach(function(_c) {
                const _o =  f.obj_from_id(_c)
                if (_o.ctypeOn) {
                    if (!_o.offTime || _o.offTime < v_min_off) {
                        if (Hub.getCharacteristicValue(_o.a_id, f.obj_hc_from_full(_o.ctypeOn))) {
                            Object.keys(v_ms_ids).forEach(function(_e){ _o.msIds[_e] = Math.max(_o.msIds[_e]||0, v_ms_ids[_e]);  })
                            _o.offTime = v_min_off;
                            f.ve_log_info("vds_ext: extendFor ${f._get_device_descr(_o)} to +${v_seconds.toFixed()}s")
                        }
                    }
                }
            })
            return builder;
        },
        setBrightness: function(p_params) {
            if (!checkAffectedDevices()) return builder;
            const v_brightness = parseInt(''+p_params,10) || 0;
            v_acc_ids.forEach(function(_c) {
                const _o = f.obj_from_id(_c)
                if (_o.ctypeBrightness) {
                   Hub.setCharacteristicValue(_o.a_id, f.obj_hc_from_full(_o.ctypeBrightness), v_brightness )
                   f.ve_log_info("vds_ext: setBrigtness ${f._get_device_descr(_o)} to ${v_brightness.toFixed()}")
                }
            })
            return builder;
        },
        changeBrightness: function(p_params) {
            if (!checkAffectedDevices()) return builder;
            const v_brightness = parseInt(''+p_params,10) || 0;
            v_acc_ids.forEach(function(_c) {
                const _o =  f.obj_from_id(_c)
                if (_o.ctypeBrightness) {
                   const curr_brightness = Hub.getCharacteristicValue(_o.a_id, f.obj_hc_from_full(_o.ctypeBrightness));
                   let dest_brightness = Math.round(curr_brightness + v_brightness);
                   if (dest_brightness < 0) dest_brightness = 0;
                   if (dest_brightness > 100) dest_brightness = 100;
                   Hub.setCharacteristicValue(_o.a_id, f.obj_hc_from_full(_o.ctypeBrightness), dest_brightness )
                   f.ve_log_info("vds_ext: changeBrigtness ${f._get_device_descr(_o)} for ${v_brightness} from ${curr_brightness} to ${dest_brightness}")
                }
            })
            return builder;
        },

        /*  hue, saturation -- ColorTemperature -- #RGBcolor -- Well-known color names, like 'red'  */
        setColor: function(p_p1, p_p2) {
            if (!checkAffectedDevices()) return builder;
            function isEmpty(value) {return (value == null || value.length === 0);}
            let v_hue, v_saturation, v_colorTemp;
            if (!isEmpty(p_p1) && !isEmpty(p_p2)) {
                v_hue = parseInt(p_p1,10);
                v_saturation = parseInt(p_p2,10);
            }
            else if (!isEmpty(p_p1)) {
                if (/^#[abcdef0-9]{6}$/i.test(p_p1) || g.name_2_rgb[p_p1.toLowerCase()] ) {
                    //log.info("convert ${p_p1} to hue")
                    let rgb = f.hexToRGB(g.name_2_rgb[p_p1.toLowerCase()] || p_p1); //log.info("{}",rgb.join('-'))
                    let hsb = f.RGBToHSB(rgb[0], rgb[1], rgb[2]); // log.info("hsb = {}",hsb.join('-'))
                    v_hue = hsb[0]
                    v_saturation = hsb[1]
                } else if (/^\d+$/i.test(p_p1)) {
                   v_colorTemp = parseInt(p_p1,10);
                }
            } else {
                f.ve_log_warning("Возможные параметры setColor: hue, saturation -- ColorTemperature -- #RGBcolor -- Well-known color names, like 'red'");
                return builder;
            }

            v_acc_ids.forEach(function(_c) {
                const _o = f.obj_from_id(_c)
                if (_o.ctypeHue && _o.ctypeSaturation) {
                   if (isEmpty(v_hue) || isEmpty(v_saturation)) {
                       f.ve_log_warning("Устройство ${f._get_device_descr(_o)} поддерживает задание цвета а не цветовой температуры");
                       return;
                   }
                   Hub.setCharacteristicValue(_o.a_id, f.obj_hc_from_full(_o.ctypeHue), v_hue)
                   Hub.setCharacteristicValue(_o.a_id, f.obj_hc_from_full(_o.ctypeSaturation), v_saturation )
                   f.ve_log_info("setColor ${f._get_device_descr(_o)} to ${v_hue.toFixed()}, ${v_saturation.toFixed()}")
                }
            })
            return builder;
        },

        // p_value_type = Hue|Brightness|On|Saturation|CurrentTemperature...
        // p_method = avg|min|max|sum|concat - default avg for numeric props and concat for string
        getValue: function(p_value_type, p_method) {
            let v_values = [];
            v_acc_ids.forEach(function(_c) {
                const _o = f.obj_from_id(_c)
                if (_o['ctype' + p_value_type]) {
                   v_values.push(Hub.getCharacteristicValue(_o.a_id, f.obj_hc_from_full(_o['ctype' + p_value_type])) )
                }
            })

            if (v_values.length === 0) return;
            if (/^(CurrentTemperature|Brightness|Hue|Saturation|CurrentRelativeHumidity|CarbonDioxideLevel)$/i.test(p_value_type)) {
                if (!p_method || p_method === 'avg') return v_values.reduce(function(_p,_c) {return _p + _c}, 0) / v_values.length;
                if (p_method === "min") return Math.min.apply(null, v_values);
                if (p_method === "max") return Math.max.apply(null, v_values);
                if (p_method === "sum") return v_values.reduce(function(_p,_c) {return _p + _c}, 0);
                if (p_method === "concat") return v_values.join(' ');
            } else {
                return v_values.join(' ');
            }

        },
        saveState: function(p_state_name) {
            /* cleanup time to time */
            if (Math.random()*100 < 10 || true ) {
                const v_now = (new Date()).getTime();
                const outdated_states_names =  Object.keys(g.saved_states)
