                local_debug && log.info('outdated names: {}',outdated_states_names.join())
                outdated_states_names.forEach(function(_e){
                     delete g.saved_states[_e];
                })

            }

            let v_state_name = p_state_name || localStateName || '_ve_' + (new Date()).getTime() + '_' +  Utils.uuid().substr(0,5);
            if (!p_state_name && !localStateName) localStateName = v_state_name;
            g.saved_states[v_state_name] = {acc: [], created: (new Date()).getTime()};
            if (local_debug) log.info("state name: {}, cuurent saved states {}", v_state_name, Object.keys(g.saved_states).join())

            v_acc_ids.forEach(function(_c) {
