        restoreState: function(p_state_name, p_options) {
            let v_state_name = p_state_name || localStateName;
            if (!v_state_name || !g.saved_states[v_state_name] || !g.saved_states[v_state_name].acc.length) {
                f.ve_log_warning("restoreState: нет сохраненного состояния");
                return builder;
            }
            let v_debug_str = "restoreState: ${v_state_name} ";
            if (local_debug) log.info(v_debug_str)
            v_acc_ids.forEach(function(_c) {
                let saved_state;
                g.saved_states[v_state_name].acc
                    .filter(function(_e) {return _e.acc_id === _c })
                       .map(function(_ee) {saved_state = _ee;} )
                if (!saved_state) return;

                const _o = f.obj_from_id(_c)
                let changeLIghtParams = false, currentOnState = false;
                let v_chrs_to_update = {}

                g.C_CHARACTERISTICS_AVAIL.forEach(function(_c_name){
                    const c_name = 'ctype' + _c_name;
                    if ( c_name in saved_state && c_name in _o) {
                        const curr_chrs_value = Hub.getCharacteristicValue(_o.a_id, f.obj_hc_from_full(_o[c_name]));
                        if (saved_state[c_name] !== curr_chrs_value) {
                            v_chrs_to_update[c_name] = { "to": saved_state[c_name], "from": curr_chrs_value};
                            changeLIghtParams = changeLIghtParams || (/^(Brightness|Hue|Saturation|ColorTemperature)$/.test(_c_name));
                        }
                        if (c_name === "ctypeOn") currentOnState = curr_chrs_value;
                    }
                })

                /* turn on if change light characteristics  */
                if (changeLIghtParams && !currentOnState) {
                    _setCharacteristic(_o,'ctypeOn',true);
                    currentOnState = true;
                }
                log.info("v_chrs_to_update = {}", JSON.stringify(v_chrs_to_update))
                for (_chrs in v_chrs_to_update) {
                    if (_chrs === "ctypeOn") continue;
                    _setCharacteristic(_o,_chrs, v_chrs_to_update[_chrs].to);
                    if (local_debug) v_debug_str += " ${f._get_device_descr(_o)}: restore ${_chrs} to ${v_chrs_to_update[_chrs].to}, was ${v_chrs_to_update[_chrs].from} ";
                }

                if ( "ctypeOn" in saved_state &&  saved_state.ctypeOn !== currentOnState) {
                    _setCharacteristic(_o,'ctypeOn', saved_state.ctypeOn, changeLIghtParams ?  500 : 0);
                    if (local_debug) v_debug_str += " ${f._get_device_descr(_o)}: restore ctypeOn to ${saved_state.ctypeOn} ";
                }

            })
            if (local_debug) log.info(v_debug_str);
            return builder;
        },

