// переопределите метод toString() так, чтобы он возвращал строку типа "10 коп." или "1 руб.", если это монетка, и "100 руб.", если это купюра
// вы должны ограничить создание класса таким образом, чтобы можно было создать только ограниченный набор номиналов (см. задание)

#include <bits/stdc++.h>
#include <ext/pb_ds/assoc_container.hpp>

#define int int64_t

#define rng(i, a, b) for (int i = a; i < b; i++)
#define rep(i, b) rng(i, 0, b)
#define gnr(i, a, b) for (int i = b - 1; i >= a; i--)
#define per(i, b) gnr(i, 0, b)

#define all(x) begin(x), end(x)
#define sz(x) int(size(x))

#define pb push_back
#define eb emplace_back
#define lb lower_bound
#define ub upper_bound

#define f first
#define s second

using namespace std;
using namespace __gnu_pbds;

void solve() {
    int n, m, c;
    cin >> n >> m >> c;

    vector<int> s(n);
    rep(i, n) {
        cin >> s[i];
    }

    vector<vector<pair<int, int>>> g(n);
    vector<int> in(n);
    rep(i, c) {
        int a, b, x;
        cin >> a >> b >> x;
        a--; b--;
        g[a].pb({b, x});
        in[b]++;
    }

    queue<int> q;
    rep(i, n) {
        if (in[i] == 0) {
            q.push(i);
        }
    }
    vector<int> ord;
    while (sz(q)) {
        int u = q.front();
        q.pop();
        ord.pb(u);
        for (auto [v, _] : g[u]) {
            if (--in[v] == 0) {
                q.push(v);
            }
        }
    }

    for (int u : ord) {
        for (auto [v, x] : g[u]) {
            s[v] = max(s[v], s[u] + x);
        }
    }

    rep(i, n) {
        cout << s[i] << '\n';
    }
}

