    }
   
    node * trie[n + 1];
    for(int i = 0; i < n; i++) {
        trie[i] = new node();
    }
    for(int i = 1; i < n; i++) {
        for(int j = 0; j < (int) v[i].size(); j++) {
            string tmp = "";
            for(int k = j; k < min(j + 60, (int) v[i].size()); k++) {
                tmp += v[i][k];
                insert_word(trie[i], tmp);
            }
        }
    }
    int res = 0;
    for(int i = 0; i < (int) v[0].size(); i++) {
        string tmp = "";
        for(int j = i; j < min(i + 60, (int) v[0].size()); j++) {
            tmp += v[0][j];
            bool ok = true;
            for(int k = 1; k < n; k++) {
                if(!search_word(trie[k], tmp)) {
                    ok = false;
                    break;
                }
            }
            if(ok) {
                res = max(res, (int) tmp.size());
            }
        }
    }
    cout << res << endl;
    return 0;
}

#include <bits/stdc++.h>
#include <ext/pb_ds/assoc_container.hpp>

#define int int64_t

#define rng(i, a, b) for (int i = a; i < b; i++)
#define rep(i, b) rng(i, 0, b)
#define gnr(i, a, b) for (int i = b - 1; i >= a; i--)
#define per(i, b) gnr(i, 0, b)

#define all(x) begin(x), end(x)
#define sz(x) int(size(x))

#define pb push_back
#define eb emplace_back
#define lb lower_bound
#define ub upper_bound

#define f first
#define s second

using namespace std;
using namespace __gnu_pbds;

const int INF = 1e18;

void solve() {
    int n, m;
    cin >> n >> m;
    vector<array<int, 4>> to_add(m);
    for (auto &[f, a, b, c] : to_add) {
        cin >> a >> b >> c >> f;
        a--; b--;
    }
    sort(all(to_add));

    vector<vector<pair<int, int>>> g(n);

    int ans = 0;
    gnr(i, 1, 1001) {
        while (!to_add.empty() && to_add.back()[0] >= i) {
            auto [_, a, b, c] = to_add.back();
            to_add.pop_back();
            g[a].pb({b, c});
            g[b].pb({a, c});
        }

        vector<int> d(n, INF);
        priority_queue<pair<int, int>, vector<pair<int, int>>, greater<pair<int, int>>> pq;
        d[0] = 0;
        pq.push({0, 0});
        while (!pq.empty()) {
            int u = pq.top().s;
            pq.pop();
            for (auto [v, w] : g[u]) {
                if (d[u] + w < d[v]) {
                    d[v] = d[u] + w;
                    pq.push({d[v], v});
                }
            }
        }

        ans = max(ans, i * int(1e6) / d[n - 1]);
    }
    cout << ans << '\n';
}   

