#ifndef LOCAL
    freopen("pump.in", "r", stdin);
    freopen("pump.out", "w", stdout);
#endif
    ios::sync_with_stdio(false);
    cin.tie(nullptr);

    int tc = 1;
    // cin >> tc;
    while (tc--) {
        solve();
    }

    return 0;
}

