CREATE DATABASE IF NOT EXISTS praca;
USE praca;


CREATE TABLE IF NOT EXISTS Ludzie (
    id INT NOT NULL AUTO_INCREMENT,
    PESEL CHAR(11),
    imie VARCHAR(30),
    nazwisko VARCHAR(30),
    data_urodzenia DATE,
    plec ENUM('K', 'M'),
    PRIMARY KEY (id)
);

CREATE TABLE IF NOT EXISTS Zawody (
    zawod_id INT NOT NULL AUTO_INCREMENT,
    nazwa VARCHAR(50),
    pensja_min FLOAT CHECK(pensja_min >= 0),
    pensja_max FLOAT CHECK(pensja_max >= 0 AND pensja_max > pensja_min),
    PRIMARY KEY (zawod_id)
);

CREATE TABLE IF NOT EXISTS Pracownicy (
    id INT NOT NULL AUTO_INCREMENT,
    PESEL CHAR(11),
    zawod_id INT,
    pensja FLOAT CHECK(pensja >= 0),
    FOREIGN KEY (PESEL) REFERENCES Ludzie(PESEL),
    FOREIGN KEY (zawod_id) REFERENCES Zawody(zawod_id),
    PRIMARY KEY (id, zawod_id)
);

-- Sprawdzenie poprawności PESELa
CREATE TRIGGER IF NOT EXISTS on_insert_ludzie BEFORE INSERT, UPDATE ON Ludzie
FOR EACH ROW
BEGIN
    DECLARE gender_checker INT;
    DECLARE month_adjuster INT;
    DECLARE control_number INT;

    SET gender_checker = CASE WHEN NEW.plec = 'M' THEN 1 ELSE 0 END;
    SET month_adjuster = CASE WHEN (YEAR(NEW.data_urodzenia) BETWEEN 2000 AND 2099)
        THEN 20 ELSE 0 END;

    SET control_number =
        MOD(
            MOD(1 * CAST(SUBSTRING(NEW.PESEL, 1, 1)  AS UNSIGNED), 10) +
            MOD(3 * CAST(SUBSTRING(NEW.PESEL, 2, 1)  AS UNSIGNED), 10) +
            MOD(7 * CAST(SUBSTRING(NEW.PESEL, 3, 1)  AS UNSIGNED), 10) +
            MOD(9 * CAST(SUBSTRING(NEW.PESEL, 4, 1)  AS UNSIGNED), 10) +
            MOD(1 * CAST(SUBSTRING(NEW.PESEL, 5, 1)  AS UNSIGNED), 10) +
            MOD(3 * CAST(SUBSTRING(NEW.PESEL, 6, 1)  AS UNSIGNED), 10) +
            MOD(7 * CAST(SUBSTRING(NEW.PESEL, 7, 1)  AS UNSIGNED), 10) +
            MOD(9 * CAST(SUBSTRING(NEW.PESEL, 8, 1)  AS UNSIGNED), 10) +
            MOD(1 * CAST(SUBSTRING(NEW.PESEL, 9, 1)  AS UNSIGNED), 10) +
            MOD(3 * CAST(SUBSTRING(NEW.PESEL, 10, 1) AS UNSIGNED), 10)
            , 10
        );
    IF (
        LENGTH(NEW.PESEL) <> 11 OR
        SUBSTRING(NEW.PESEL, 1, 2) <> SUBSTRING(YEAR(NEW.data_urodzenia), 3, 2) OR
        SUBSTRING(NEW.PESEL, 3, 2) <> (MONTH(NEW.data_urodzenia) + month_adjuster) OR
        SUBSTRING(NEW.PESEL, 5, 2) <> DAYOFMONTH(NEW.data_urodzenia) OR
        MOD((CAST(SUBSTRING(NEW.PESEL, 10, 1) AS UNSIGNED)), 2) <> gender_checker OR
        control_number <> SUBSTRING(NEW.PESEL, 11, 1)
    ) THEN
        SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = "Niepoprawny numer PESEL!";
    END IF;
END;

-- Generowanie poprawnego PESELa
CREATE FUNCTION IF NOT EXISTS generuj_pesel(data_urodzenia DATE, plec CHAR)
RETURNS CHAR(11)
BEGIN
    DECLARE pesel CHAR(11);
    DECLARE gender_digit INT;
    DECLARE month_adjuster INT;

    SET gender_digit = CASE WHEN plec = 'K' THEN 2 ELSE 1 END;
    SET month_adjuster = CASE WHEN YEAR(data_urodzenia) >= 2000 THEN 20 ELSE 0 END;

    SET pesel = CONCAT(
            SUBSTRING(YEAR(data_urodzenia), 3, 2),
            LPAD((MONTH(data_urodzenia) + month_adjuster), 2, '0'),
            LPAD(DAYOFMONTH(data_urodzenia), 2, '0'),
            FLOOR(RAND()*10),
            FLOOR(RAND()*10),
            FLOOR(RAND()*10),
            gender_digit
        );
        SET pesel = CONCAT(
            pesel,
            MOD(
                MOD(1 * CAST(SUBSTRING(pesel, 1, 1) AS UNSIGNED), 10) +
                MOD(3 * CAST(SUBSTRING(pesel, 2, 1) AS UNSIGNED), 10) +
                MOD(7 * CAST(SUBSTRING(pesel, 3, 1) AS UNSIGNED), 10) +
                MOD(9 * CAST(SUBSTRING(pesel, 4, 1) AS UNSIGNED), 10) +
                MOD(1 * CAST(SUBSTRING(pesel, 5, 1) AS UNSIGNED), 10) +
                MOD(3 * CAST(SUBSTRING(pesel, 6, 1) AS UNSIGNED), 10) +
                MOD(7 * CAST(SUBSTRING(pesel, 7, 1) AS UNSIGNED), 10) +
                MOD(9 * CAST(SUBSTRING(pesel, 8, 1) AS UNSIGNED), 10) +
                MOD(1 * CAST(SUBSTRING(pesel, 9, 1) AS UNSIGNED), 10) +
                MOD(3 * CAST(SUBSTRING(pesel, 10, 1) AS UNSIGNED), 10),
                10
            )
        );

    RETURN pesel;
END;

