#define rep(i, b) rng(i, 0, b)
#define gnr(i, a, b) for (int i = b - 1; i >= a; i--)
#define per(i, b) gnr(i, 0, b)

#define all(x) begin(x), end(x)
#define sz(x) int(size(x))

#define pb push_back
#define eb emplace_back
#define lb lower_bound
#define ub upper_bound

#define f first
#define s second

using namespace std;
using namespace __gnu_pbds;

const int INF = 1e18;

void solve() {
    int n, m;
    cin >> n >> m;

    vector<int> t(n);
    rep(i, n) {
        cin >> t[i];
        t[i]--;
    }

    vector<vector<int>> g(n);
    rep(i, n - 1) {
        int u, v;
        cin >> u >> v;
        u--; v--;
        g[u].pb(v);
        g[v].pb(u);
    }

    vector<int> dep(n, INF);
    vector<vector<int>> up(n, vector<int>(__lg(n) + 1));
    queue<int> q;
    dep[0] = 0;
    q.push(0);
    while (!q.empty()) {
        int u = q.front();
        q.pop();
        for (int v : g[u]) {
            if (dep[v] == INF) {
                dep[v] = dep[u] + 1;

                up[v][0] = u;
                rep(i, __lg(n)) {
                    up[v][i + 1] = up[up[v][i]][i];
                }
                
                q.push(v);
            }
        }
    }

    auto lca = [&](int a, int b) -> int {
        if (dep[a] < dep[b]) {
            swap(a, b);
        }
        int diff = dep[a] - dep[b];
        per(i, __lg(n) + 1) {
            if ((diff >> i) & 1) {
                a = up[a][i];
            }
        }
        if (a == b) {
            return a;
        }
        per(i, __lg(n) + 1) {
            if (up[a][i] != up[b][i]) {
                a = up[a][i];
                b = up[b][i];
            }
        }
        return up[a][0];
    };

    vector<array<int, 3>> queries(m);
    vector<vector<int>> find(n);
    for (auto &[a, b, c] : queries) {
        cin >> a >> b >> c;
        a--; b--; c--;
        find[a].pb(c);
        find[b].pb(c);
    }

    vector<stack<int>> occs(n);
    map<pair<int, int>, int> mx_dep;
    auto dfs = [&](int u, int p, auto &&dfs) -> void {
        occs[t[u]].push(dep[u]);

        for (int x : find[u]) {
            mx_dep[{u, x}] = occs[x].empty() ? -INF : occs[x].top();
        }

        for (int v : g[u]) {
            if (v != p) {
                dfs(v, u, dfs);
            }
        }

        occs[t[u]].pop();
    };
    dfs(0, -1, dfs);

    for (auto [a, b, c] : queries) {
        cout << (max(mx_dep[{a, c}], mx_dep[{b, c}]) >= dep[lca(a, b)]);
    }
    cout << '\n';
}

int32_t main() {
#ifndef LOCAL
    freopen("milkvisits.in", "r", stdin);
    freopen("milkvisits.out", "w", stdout);
#endif
    ios::sync_with_stdio(false);
    cin.tie(nullptr);

    int tc = 1;
    // cin >> tc;
    while (tc--) {
        solve();
    }

    return 0;
}

