def delit(n):
    ans = []
    d = 2
    while d * d <= n:
        if n % d == 0 and d != 9 and str(d)[-1] == '9':
            ans.append(d)
        d_b = n // d
        if d != d_b and d_b != 9 and str(d_b)[-1] == '9':
            ans.append(d_b)
        d += 1
    ans.sort()
    return ans
for i in range(600_000 + 1, 10**9):
    if len(delit(i)) != 0:
        print(i, min(delit(i)))

def f(x, y):
    if x > y:
        return 0
    if x == y:
        return 1
    if x < y:
        return f(x + 1, y) + f(x + 3, y) + f(x * 3, y)
print(f(3, 9) * f(9, 27) * f(27, 31))

